import { styled } from "styled-components";

export const Container = styled.div`
  position: relative;
  margin: 0 auto;
  width: 393px;
  height: 852px;
  margin-top: 0px;
  background: linear-gradient(180deg, #0c2456 0%, #0a759f 100%);

  #header {
    height: 70px;
    display: flex;
    flex-direction: row;
    text-align: right;
  }
`;

export const Back = styled.div`
  width: 24px;
  height: 24px;
  flex-shrink: 0;
`;
